import {SIGNERS} from "./constants";
import {Signer} from "./types";
import {WalletSigner} from "./walletSigner";
import {BrowserAlgoSigner} from "./algoSigner";
import {LogicSigner} from "./logicSigner";
import {MyAlgoWalletSigner} from "./myAlgoWalletSigner";
import {PeraWalletSigner} from "./peraWalletSigner";
import {DevWalletSigner} from "./devWalletSigner";

const ws = new WalletSigner();
const as = new BrowserAlgoSigner();
const ls = new LogicSigner();
const maws = new MyAlgoWalletSigner();
const ps = new PeraWalletSigner();
const ds = new DevWalletSigner();

export function getSigner(name: string): Signer{
    if (name === SIGNERS.WALLET) {
        return ws;
    }
    else if (name === SIGNERS.ALGO_SIGNER) {
        return as;
    }
    else if (name === SIGNERS.LOGIC_SIG) {
        return ls;
    }
    else if (name === SIGNERS.MY_ALGO_WALLET) {
        return maws;
    }
    else if (name === SIGNERS.PERA_WALLET) {
        return ps;
    }
    else if (name === SIGNERS.DEV_WALLET) {
        return ds;
    }

    return ws;
}

export interface SupportedSigner {
    name: string
    label: string
    logo: string
    instance: Signer
}

export function getSupportedSigners(): SupportedSigner[] {
    return [
        {
            name: SIGNERS.ALGO_SIGNER,
            label: 'AlgoSigner',
            instance: getSigner(SIGNERS.ALGO_SIGNER),
            logo: 'data:image/jpeg+xml;base64,'
        },
        {
            name: SIGNERS.MY_ALGO_WALLET,
            label: 'MyAlgo Wallet',
            instance: getSigner(SIGNERS.MY_ALGO_WALLET),
            logo: 'data:image/svg+xml;base64,'
        },
        {
            name: SIGNERS.PERA_WALLET,
            label: 'Pera Wallet',
            instance: getSigner(SIGNERS.PERA_WALLET),
            logo: 'data:image/png;base64,'
        },
        {
            name: SIGNERS.DEV_WALLET,
            label: 'Dev Wallet',
            instance: getSigner(SIGNERS.DEV_WALLET),
            logo: 'data:image/png;base64,'
        }
    ];
}